<script lang="ts">
    import {onDestroy, onMount} from "svelte";
    import {GrandDataDistributor} from "$lib";

    export let size:'sm'|'lg' = 'sm'

    let boot_state:SVGGElement;
    let est_con_state:SVGGElement;
    let idle_state:SVGGElement;
    let run_conf_state:SVGGElement;
    let exit_state:SVGGElement;
    let hv_on_state:SVGGElement;
    let emerg_brake_state:SVGGElement;
    let levi_state:SVGGElement;
    let moving_st:SVGGElement;
    let moving_ls_cv:SVGGElement;
    let moving_ls_end:SVGGElement;
    let moving_st_end:SVGGElement;
    let moving_ls_st: SVGGElement;
    let all_states: SVGGElement[];


    const storeManager = GrandDataDistributor.getInstance().stores;
    const fsmState = storeManager.getStore("FSMState");

    function turn_on(state:SVGGElement) {
        if (!state || !state.style) return;
        if (state === emerg_brake_state) {
            state.style.fill = '#D61111'
        } else {
            state.style.fill = '#0EA774'
        }
    }

    function turn_off_all(states:SVGGElement[]) {
        states.forEach(s => {
            if (!s || !s.style) return;
            s.style.fill = 'none'
        });
    }

    let interval: NodeJS.Timeout;

    onMount(() => {
        all_states = [boot_state, est_con_state, idle_state, run_conf_state, exit_state, hv_on_state, emerg_brake_state, levi_state, moving_st, moving_ls_cv, moving_ls_end, moving_st_end, moving_ls_st];

        interval = setInterval(() => {
            turn_off_all(all_states);
            turn_on(all_states[$fsmState % all_states.length])
        }, 100)
    })

    onDestroy(() => {
        clearInterval(interval)
    });


</script>

